piya-_1_-_1_-_1_-_1_.png";s:22:"webp_slider_popup_full";s:80:"/upload/resize_cache/main/904/1024_787_1_95/042A6510-kopiya-_1_-_1_-_1_-_1_.webp";}s:4:"name";s:46:"Корнеев Игорь Алексеевич";s:8:"position";s:161:"Главный врач, врач уролог-андролог высшей категории, доктор медицинских наук, профессор";s:2:"id";s:2:"13";}s:8:"question";a:7:{s:5:"title";s:12:"Вопрос";s:4:"name";s:14:"Алексей";s:5:"image";s:0:"";s:8:"position";s:0:"";s:4:"text";s:1185:"Здравствуйте, есть 2 вопроса:
1. сегондя ночью девушка немного поцарапала зубами головку полового члена, примрено 1 мм в ширину и 5мм в длину, немного покровило, обработал перекисью водорода и утром мирамистином. дсоаточно ли будет утрмои  вечермо обрабатывать миамистином или нужно ещё что-то делать?
2. уже больше полгода периодически под крайней плотью появляютсятакие как белые катышки. появлятся периодически сами по себе. потом пропадают на некоторое время. обращался в кож-вен дважды, брали мазок из уретры, соскоб на грибы-говорят ничего нет. что это могло бы быть и что ещё делать, потому что оно не проходт и всё также периодически появляется";s:5:"files";s:0:"";s:4:"date";s:21:"3 августа 2019";}s:6:"answer";a:8:{s:5:"title";s:10:"Ответ";s:4:"name";s:46:"Корнеев Игорь Алексеевич";s:5:"image";a:18:{s:8:"ORIGINAL";s:52:"/upload/main/904/042A6510-kopiya-_1_-_1_-_1_-_1_.png";s:13:"webp_ORIGINAL";s:75:"/upload/resize_cache/main/904/0_0_1_95/042A6510-kopiya-_1_-_1_-_1_-_1_.webp";s:9:"100_100_P";s:75:"/upload/resize_cache/main/904/100_100_1/042A6510-kopiya-_1_-_1_-_1_-_1_.png";s:14:"webp_100_100_P";s:79:"/upload/resize_cache/main/904/100_100_1_95/042A6510-kopiya-_1_-_1_-_1_-_1_.webp";s:19:"quotas_registration";s:75:"/upload/resize_cache/main/904/190_200_1/042A6510-kopiya-_1_-_1_-_1_-_1_.png";s:24:"webp_quotas_registration";s:79:"/upload/resize_cache/main/904/190_200_1_95/042A6510-kopiya-_1_-_1_-_1_-_1_.webp";s:15:"specialist_list";s:75:"/upload/resize_cache/main/904/352_304_1/042A6510-kopiya-_1_-_1_-_1_-_1_.png";s:20:"webp_specialist_list";s:79:"/upload/resize_cache/main/904/352_304_1_95/042A6510-kopiya-_1_-_1_-_1_-_1_.webp";s:19:"specialist_list_big";s:52:"/upload/main/904/042A6510-kopiya-_1_-_1_-_1_-_1_.png";s:24:"webp_specialist_list_big";s:79:"/upload/resize_cache/main/904/568_548_1_95/042A6510-kopiya-_1_-_1_-_1_-_1_.webp";s:24:"specialist_detail_header";s:52:"/upload/main/904/042A6510-kopiya-_1_-_1_-_1_-_1_.png";s:29:"webp_specialist_detail_header";s:79:"/upload/resize_cache/main/904/448_471_1_95/042A6510-kopiya-_1_-_1_-_1_-_1_.webp";s:26:"specialist_detail_schedule";s:75:"/upload/resize_cache/main/904/320_436_1/042A6510-kopiya-_1_-_1_-_1_-_1_.png";s:31:"webp_specialist_detail_schedule";s:79:"/upload/resize_cache/main/904/320_436_1_95/042A6510-kopiya-_1_-_1_-_1_-_1_.webp";s:20:"slider_photo_preview";s:75:"/upload/resize_cache/main/904/438_264_1/042A6510-kopiya-_1_-_1_-_1_-_1_.png";s:25:"webp_slider_photo_preview";s:79:"/upload/resize_cache/main/904/438_264_1_95/042A6510-kopiya-_1_-_1_-_1_-_1_.webp";s:17:"slider_popup_full";s:52:"/upload/main/904/042A6510-kopiya-_1_-_1_-_1_-_1_.png";s:22:"webp_slider_popup_full";s:80:"/upload/resize_cache/main/904/1024_787_1_95/042A6510-kopiya-_1_-_1_-_1_-_1_.webp";}s:8:"position";s:161:"Главный врач, врач уролог-андролог высшей категории, доктор медицинских наук, профессор";s:4:"text";s:225:"Здравствуйте. Рекомендую Вам обратиться к урологу, который сможет произвести осмотр и ответит после этого на Ваши вопросы.";s:5:"files";s:0:"";s:4:"date";s:21:"3 августа 2019";s:13:"specialist_id";s:2:"13";}}i:4927;a:5:{s:15:"DETAIL_PAGE_URL";s:23:"/patients/consult/4927/";s:16:"isAnswererClinic";b:1;s:8:"answerer";a:4:{s:5:"image";a:2:{s:8:"ORIGINAL";s:29:"/upload/images/logo-short.png";s:7:"resized";s:29:"/upload/images/logo-short.png";}s:4:"name";s:8:"МЦРМ";s:8:"position";s:0:"";s:2:"id";s:0:"";}s:8:"question";a:7:{s:5:"title";s:12:"Вопрос";s:4:"name";s:10:"Алина";s:5:"image";s:0:"";s:8:"position";s:0:"";s:4:"text";s:501:"К предыдущему вопросу... Если делать эко с донорскими яйцеклеткой и сперматозоидом какие анализы должна  буду сдать я? Эндометрий у меня обычно на 13-14 д ц около 8-9 мм. Инфекций нет, мазки в норме. Пролактин повышен - 686.. Повлияет ли он на вынашиваемость? Спасибо заранее за ответ)";s:5:"files";s:0:"";s:4:"date";s:22:"14 декабря 2013";}s:6:"answer";a:8:{s:5:"title";s:10:"Ответ";s:4:"name";s:8:"МЦРМ";s:5:"image";a:2:{s:8:"ORIGINAL";s:29:"/upload/images/logo-short.png";s:7:"resized";s:29:"/upload/images/logo-short.png";}s:8:"position";s:0:"";s:4:"text";s:230:"Реципиент проходит обследование , необходимое для проведения ЭКО. объем обследования определяет доктор на первичном приеме. ";s:5:"files";s:0:"";s:4:"date";s:22:"14 декабря 2013";s:13:"specialist_id";s:0:"";}}i:17583;a:5:{s:15:"DETAIL_PAGE_URL";s:24:"/patients/consult/17583/";s:16:"isAnswererClinic";b:1;s:8:"answerer";a:4:{s:5:"image";a:2:{s:8:"ORIGINAL";s:29:"/upload/images/logo-short.png";s:7:"resized";s:29:"/upload/images/logo-short.png";}s:4:"name";s:8:"МЦРМ";s:8:"position";s:0:"";s:2:"id";s:0:"";}s:8:"question";a:7:{s:5:"title";s:12:"Вопрос";s:4:"name";s:12:"Марина";s:5:"image";s:0:"";s:8:"position";s:0:"";s:4:"text";s:615:"Добрый день.Подскажите,пожалуйста, прижигали эрозию сургитроном 20 мая, из выделений была желтенькая водичка,, а с 26 мая пошли кровянистые выделения, они кратковременные.Гинеколог сказал придти на прием только через 1,5 месяца, подскажите, это норма для таких выделений и можно посетить врача планово, или нужно срочно обратиться.Спасибо.";s:5:"files";s:0:"";s:4:"date";s:14:"27 мая 2019";}s:6:"answer";a:8:{s:5:"title";s:10:"Ответ";s:4:"name";s:8:"МЦРМ";s:5:"image";a:2:{s:8:"ORIGINAL";s:29:"/upload/images/logo-short.png";s:7:"resized";s:29:"/upload/images/logo-short.png";}s:8:"position";s:0:"";s:4:"text";s:350:"Здравствуйте, Марина! Такие выделения могут быть после отхождения струпа (корочки в месте прижигания эрозии). Если выделения усилятся, то обязательно запишитесь на консультацию к гинекологу.";s:5:"files";s:0:"";s:4:"date";s:14:"27 мая 2019";s:13:"specialist_id";s:0:"";}}}s:4:"path";s:18:"/patients/consult/";}}';
